import './App.css';
import Navigation from "./components/Navigation/Navigation";
import Logo from "./components/Logo/Logo";
import ImageLinkForm from "./components/ImageLinkForm/ImageLinkForm";
import Rank from "./components/Rank/Rank";


import React, {Component} from 'react';


  // apiKey: "c656b5f60b5142fdab262103fa9124bc"


////////////////////////////////////////////////////////////////////////////////////
// In this section, we set the user authentication, app and model IDs, and the URL
// of the image we want as an input. Change these strings to run your own example.
////////////////////////////////////////////////////////////////////////////////////

const USER_ID = 'zzyzol4gs8j3';
// Your PAT (Personal Access Token) can be found in the portal under Authentification
const PAT = '97d6df1af3274f5f98e785375a707e99';
const APP_ID = 'face-detection-app';
const MODEL_ID = 'people-detection-yolov5';
const MODEL_VERSION_ID = 'a7ab2517c6e24364a479cd42d405e714';
// Change this to whatever image URL you want to process
const IMAGE_URL = 'https://i0.wp.com/post.medicalnewstoday.com/wp-content/uploads/sites/3/2020/03/GettyImages-1092658864_hero-1024x575.jpg?w=1155&h=1528';

///////////////////////////////////////////////////////////////////////////////////
// YOU DO NOT NEED TO CHANGE ANYTHING BELOW THIS LINE TO RUN THIS EXAMPLE
///////////////////////////////////////////////////////////////////////////////////

const raw = JSON.stringify({
  "user_app_id": {
    // "user_id": USER_ID,
    // "app_id": APP_ID
  },
  "inputs": [
    {
      "data": {
        "image": {
          "url": IMAGE_URL
        }
      }
    }
  ]
});

const requestOptions = {
  method: 'POST',
  headers: {
    'Accept': 'application/json',
    'Authorization': 'KEY' + PAT
  },
  body: raw
};

console.log(requestOptions)

// NOTE: MODEL_VERSION_ID is optional, you can also call prediction with the MODEL_ID only
// https://api.clarifai.com/v2/models/{YOUR_MODEL_ID}/outputs
// this will default to the latest version_id

fetch("https://api.clarifai.com/v2/models/" + USER_ID + "/apps/" + APP_ID + "/models", MODEL_ID + "/outputs",requestOptions)
  .then(response => response.text())
  .then(result => console.log(result))
  .catch(error => console.log('error', error));


class App extends Component {
  constructor() {
    super();
    this.state= {
      input: '',
    }
  }

  onInputChange = (event) => {
    console.log(event.target.value)
  }

  onSubmit = () => {
    console.log('click')
  }


  render() {
    return (
      <div className="App">
        <Navigation />
        <Logo />
        <Rank />
        <ImageLinkForm onInputChange={this.onInputChange} onSubmit={this.onSubmit} />
        {/*

        <FaceRecognition />*/}
      </div>
    );
  }
}

export default App;
